func fw(m *image.RGBA) {
    
}

func f(m *image.RGBA) {
    var x float64
    var y float64

    draw.Draw(m, m.Bounds(), &image.Uniform{bgcolor}, image.ZP, draw.Src)
    t := rand.Float64() * math.Pi / 4.0
    x, y = lines[rand.Intn(len(lines))](t)
    m.Set(int(x), -int(y), color.RGBA{uint8(rand.Intn(256)), uint8(rand.Intn(256)), uint8(rand.Intn(256)), 255})
}

func main() {
    log.SetFlags(0)
    driver.Main(func(s screen.Screen) {
        rand.Seed(time.Now().UnixNano())

        w, err := s.NewWindow(
            &screen.NewWindowOptions{
                Width:  windowWidth,
                Height: windowHeight,
            },
        )
        if err != nil {
            log.Fatal(err)
        }
        defer w.Release()

        winSize := image.Point{windowWidth, windowHeight}
        b, err := s.NewBuffer(winSize)
        if err != nil {
            log.Fatal(err)
        }
        defer b.Release()

        draw.Draw(b.RGBA(), b.RGBA().Bounds(), &image.Uniform{bgcolor}, image.ZP, draw.Src)

        t, err := s.NewTexture(winSize)
        if err != nil {
            log.Fatal(err)
        }
        defer t.Release()
        t.Upload(image.Point{}, b, b.Bounds())

        for {
            e := w.NextEvent()

            switch e := e.(type) {
            case lifecycle.Event:
                if e.To == lifecycle.StageDead {
                    return
                }

            case key.Event:
                if e.Code == key.CodeEscape {
                    return
                }

            case paint.Event:
                w.Upload(image.Point{0, 0}, b, b.Bounds())
                w.Publish()

            case mouse.Event:
                f(b.RGBA())
                w.Upload(image.Point{0, 0}, b, b.Bounds())
                w.Publish()

            case error:
                log.Print(e)
            }
        }

    })
}
